import React from 'react'

const ListItem = (props) => {
    return (
        <div>
        <h3>{props.book.title} :: {props.book.id}</h3>
        <h7>{props.book.isbn}</h7>
        <h5>{props.book.author.firstname} {props.book.author.lastname}</h5>
        </div>
    )
}

export default ListItem
